import React, {useContext} from 'react'

import TemaContext from '../../../contexts/TemaContext'

const Footer = () => {
    const tema = useContext(TemaContext)

    return (
        <div style={{
            'backgroundColor': tema.bg,
            'width': '100%',
        }}>
            <p  style={{
                'color': tema.fontColor,
                'padding': '10px'
            }}> Copyright &copy; Gabriel</p>
        </div>
    )
}

export default Footer
